phone number.', 'Form Contact', '', 'publish', 'closed', 'closed', '', 'form-contact', '', '', '2023-09-29 17:16:20', '2023-09-29 17:16:20', '', 0, 'http://localhost/wp-01-easy-school/?post_type=wpcf7_contact_form&#038;p=71', 0, 'wpcf7_contact_form', '', 0),
